Hello! This is the D Billions Vlog! In today's vlog you will learn the best cake recipe. How to make a cake? Our heroes will try themselves as confectioners and tell you the secrets of making cakes. And who are confectioners? They are professional cooks who make confectioneries like desserts and other types of sweets. They work at big hotels, restaurants, bakeries and coffee shops. It is said that this vocation may have originated in India or Egypt, it's hard to tell for sure, however, it is certain that they were always popular in royal court. These are people who make celebrations possible! Do you think our heroes can be confectioners? Let's see! 

Recipe for two bento-cakes from DBillions: 
Biscuit: 
Eggs - 2;
Sugar - 75 grams;
Flour - 95 grams;
Baking powder - 1/3 teaspoon;
Milk - 35 grams;
Vegetable oil - 15 grams. 

Cream for stuffing:
Cottage cheese - 350 grams; 
Milk cream 33% - 100 grams;
Powdered cream - 50 grams. 

Cream for topping: 
Cottage cheese - 350 grams;
Butter - 100 grams;
Powdered sugar - 60 grams. 

Happy watching and bon appetit!

